import "./style.css";

const FotosGallery = ({ data }) => {
  console.log(data);
  return (
    <article>
      <ul className="gallerylist">
        {data.map((image, index) => {
          return (
            <li key={index}>
              <img src={image} alt={image} />
            </li>
          );
        })}
      </ul>
    </article>
  );
};
export default FotosGallery;
